import React from "react";
import styled from "styled-components";

const Container = styled.div`
  width: 360px;
  margin-bottom: 45px;
  cursor: pointer;
`;

const Image = styled.img`
  width: 100%;
  height: 202px;
  background-color: #999;
`;

const Details = styled.div`
  display: flex;
  margin-top: 16px;
  gap: 12px;
`;

const ChannelImage = styled.img`
  width: 36px;
  height: 36px;
  border-radius: 50%;
  background-color: #999;
`;

const Texts = styled.div``;
const Title = styled.h1``;
const ChannelName = styled.h2``;
const Info = styled.div``;

export const Card = () => {
  return (
    <Container>
      <Image />
      <Details>
        <ChannelImage />
        <Texts>
          <Title>Video</Title>
          <ChannelName>QaymaQTube</ChannelName>
          <Info>548 382 views. 1 day ago</Info>
        </Texts>
      </Details>
    </Container>
  );
};
